<p><strong>"PR complete" and "release by"</strong></p>
<p>We generally talk about two dates when it comes to upcoming releases:</p>

<strong>PR complete</strong> or <strong>"all PRs out by"</strong>: this is the date when all pull requests that are intended to be part of the release should be functionally complete and out for review. It's OK if it still needs a few updates, but expectations on pending PRs should be that they'll wrap up within a business day or two. This is what's tracked in our sprints.
<strong>Release</strong> or <strong>"release by"</strong>: This is roughly the "P95" estimate for the latest the publicly-available release packages are published and available under the assumption that the corresponding PR complete date holds. This is an estimate that's intended to be conservative -- most releases happen before the projected date, but <strong>release is always gated by readiness</strong> and it's possible for things to get postponed. Estimated release dates may be communicated to customers, but only with the clarification that it's a target and not a guarantee.

<p>The single "source of truth" for the SDK's "PR complete" date is the sprint definition on Azure DevOps: <a href="https://msasg.visualstudio.com/Skyman/_sprints/taskboard/Carbon%20Team/Skyman/Carbon/">https://msasg.visualstudio.com/Skyman/_sprints/taskboard/Carbon%20Team/Skyman/Carbon/</a></p>
<p>See the sprint date range definition in the upper right, e.g.:</p>
<p><img src="https://media.microsoft.ghe.com/user/5475/files/00c74e6f-de09-45dc-ae56-2954ee12006d"/></p>
<p>"Release by" dates, meanwhile, are generally estimated at about two weeks past PR complete -- time enough for in-flight PRs to wrap up, release candidates to be built and validated across all languages/environments, documentation and other external repository resources to be staged, and bits to be published.</p>
<p>The dates here are replicated for convenience and history. This may not always be entirely up to date; please check the sprint board above or contact the team (cdev) if anything's unclear!</p>
<h3>Release planning</h3>
<p><a href="./planning.md">SDK planning -- Wiki</a></p>
<h3>Release signoff</h3>
<p><a href="https://microsoft.sharepoint.com/teams/Carbon2/_layouts/OneNote.aspx?id=%2Fteams%2FCarbon2%2FSiteAssets%2FCarbon%20Notebook&amp;wd=target%28Release.one%7C47758B05-9653-4BA3-B15F-0737A0AB5880%2F%29">SDK release process -- OneNote</a></p>","title":"AI Cognitive Services SDK Releases","url":"https://openaisdktestdatastorage.blob.core.windows.net/fileupload-openai-test-index-carbon-wiki/release.md","filepath":"release.md","chunk_id":"0"},{"content":"<p>Customize your build for Embedded Speech</p>
<p>Embedded speech (recognition, synthesis) support is not enabled by default. To enable it, download and configure the following external components:
* ONNX runtime
 * Download build artifacts as instructed in external\onnx_runtime\README.md.</p>

SR runtime and models
Download build artifacts as instructed in external\sr_runtime\README.md.
Add -DEXTENSION_RNNT_ENABLED=true to Carbon cmake options to enable the feature.
It is not necessary to download all SR models if not specifically needed. cxx_api_tests uses FP\en-US\V4\onnx and whatever the latest FP\en-US\V#\onnx and FP\de-DE\V#\onnx models are (# = the highest version number available).
If running cxx_api_tests, add --offlineModelPathList=path\to\model(s) to command-line options.

<p>Complete embedded SR tests require also embedded TTS, as well as KWS and GStreamer (see Customized extensions in this document).</p>


<p>TTS runtime and voices</p>

Download build artifacts as instructed in external\offline_tts\README.md.

<p>Add -DEXTENSION_HYBRID_TTS_ENABLED=true to Carbon cmake options to enable the feature.</p>


<p>1DS C/C++ SDK libraries for embedded speech telemetry on Windows</p>

Download build artifacts as instructed in external\cpp_client_telemetry_windows\README.md.

Customized extensions
<p>Carbon builds a variety of optional extensions that aren't included in the build project by default. Each has a set of setup instructions, usually involving downloading a build artifact, and each has a cmake flag to enable it in your local build.
 The "source of truth" for these extensions is the CMakeLists.txt file in the root folder of your clone; search for "EXTENSION_" or "DEXTENSION". As a snap:</p>



Extension
Vision/Speech
